function detailDocumentPaymentDialog(el) {
    var data = $(el).data('detail');
    $('.clear').val('');
    $('#md-DocumentPayment-detail').modal('show');

				$('#Detail-DocumentPayment-Active').prop('checked', data.active);
				$('#Detail-DocumentPayment-Code').val(data.code);
				$('#Detail-DocumentPayment-Description').val(data.description);
				$('#Detail-DocumentPayment-FileExtension').val(data.fileExtension);
				$('#Detail-DocumentPayment-FileMaxSize').val(data.fileMaxSize);
				$('#Detail-DocumentPayment-IsMandatory').prop('checked', data.isMandatory);
				$('#Detail-DocumentPayment-MasterValueCode').val(data.masterValueCode);
				$('#Detail-DocumentPayment-MasterValueText').val(data.masterValueText);
				$('#Detail-DocumentPayment-ProgramDana').val(data.programDana);
				$('#Detail-DocumentPayment-Sort').val(data.sort);
				$('#Detail-DocumentPayment-Title').val(data.title);
				$('#Detail-DocumentPayment-Type').val(data.type);

}
